INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.029, 105, 101, 122601, 0, 1.5, 1, 0, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 160, 1, 1);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.014, 111, 102, 122401, 0, 2.5, 3, 1, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0, 120, 2, 2);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.017, 105, 103, 122501, 1, 2.5, 2, 0, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 350, 3, 3);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.016, 105, 104, 107501, 0, 1.5, 3, 1, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0, 130, 4, 4);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.014, 105, 105, 107601, 0, 2.5, 1, 0, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 1, 160, 5, 5);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (120, 0.029, 103, 106, 107801, 1, 3.5, 2, 0, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 255, 6, 6);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (120, 0.013, 103, 107, 110601, 0, 3.5, 1, 0, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 1, 160, 7, 7);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.014, 103, 108, 110401, 1, 2.5, 2, 0, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 350, 8, 8);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.012, 100, 109, 110501, 0, 1.5, 3, 1, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0, 130, 9, 9);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.014, 103, 110, 115701, 0, 2.5, 1, 0, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 1, 200, 10, 10);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.071, 103, 111, 113601, 1, 2.5, 2, 0, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 350, 11, 11);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (120, 0.014, 103, 112, 107901, 0, 1.5, 3, 1, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0, 130, 12, 12);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.022, 105, 113, 108001, 0, 1.5, 2, 0, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 1, 200, 13, 13);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.031, 108, 114, 110301, 0, 2.5, 1, 0, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 1, 160, 14, 14);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.036, 105, 115, 107701, 0, 0.5, 1, 1, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0, 130, 15, 15);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.048, 95, 116, 113101, 1, 3.5, 2, 0, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 350, 16, 16);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.043, 105, 117, 113301, 0, 1.5, 3, 1, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0, 130, 17, 17);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.018, 95, 118, 113201, 0, 1.5, 2, 1, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0, 130, 18, 18);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.021, 108, 119, 117001, 0, 2.5, 2, 0, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 1, 160, 19, 19);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.036, 105, 120, 113501, 1, 2.5, 1, 0, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 255, 20, 20);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.02, 105, 121, 113401, 1, 2.5, 3, 0, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 350, 21, 21);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.018, 105, 122, 110101, 0, 2.5, 1, 1, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0, 130, 22, 22);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.03, 111, 123, 110001, 0, 3.5, 3, 0, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 1, 160, 23, 23);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.027, 103, 124, 117201, 0, 1.5, 1, 1, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0, 130, 24, 24);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.02, 108, 125, 117301, 0, 3.5, 2, 0, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 1, 160, 25, 25);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.04, 105, 126, 117401, 1, 2.5, 3, 0, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 350, 26, 26);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.009, 105, 127, 117101, 1, 3.5, 1, 0, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 350, 27, 27);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (120, 0.022, 105, 128, 122901, 1, 3.5, 1, 0, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 255, 28, 28);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (110, 0.028, 105, 129, 122801, 0, 2.5, 3, 1, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0, 130, 29, 29);
INSERT INTO `v1_e0cdd776da3f2aa40717185bb281d139e51b18cdf23d33a0f8d44e2b6570b16f` VALUES (105, 0.023, 108, 130, 122701, 0, 3.5, 2, 0, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 1, 130, 30, 30);
